import React from "react";

const MCNO = () => {
  return (
    <div>
      <br />
      <h1>Microcorruption: New Orleans</h1>
      2021-02-28
      <br />
      <br />
      This will be the first of a series of posts where I detail my answers to
      various <a href="https://microcorruption.com/">microcorruption</a> ctf
      challenges. The objective of these challenges is to unlock a device by
      reverse engineering its code and exploiting its bugs.
    </div>
  );
};

export default MCNO;
